import React, { useState } from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";

function Navbar() {
  const [show, setShow] = useState(false);
  const handleClick = () => setShow(!show);

  return (
    <nav className="nav">
      <Link to="/">
        <h1 className="nav__logo">SANAT</h1>
      </Link>
      <div className="burger-menu" onClick={handleClick}>
        <div className={show ? "bar1 change1" : "bar1"} />
        <div className={show ? "bar2 change2" : "bar2"} />
        <div className={show ? "bar3 change3" : "bar3"} />
      </div>
      <ul className={show ? "nav__items show" : "nav__items"}>
        <Link to="/">
          <li className="nav__item">Home</li>
        </Link>
        <Link to="/content">
          <li className="nav__item">Content</li>
        </Link>
        <Link to="/contact">
          <li className="nav__item">Contact</li>
        </Link>
      </ul>
    </nav>
  );
}

export default Navbar;
